    const [data, setData] = useState([])
    let {id} = useParams()

    function BuyData() {
        axios.get("http://localhost:3000/products/" + id)
            .then((res) => {
                console.log(res.data);
                setData(res.data)
            })
    }

    useEffect(() => {
        if (id) {
            BuyData();
        }
    },[])
    return (
        <>
        <h1>sisroi</h1>
      

        <div>

        <h1>hjjhjhjj</h1>
        
          
                      <div>
                        <h1>{data.id}</h1>
                        {/* <img src={data.image}alt="d" class="img-fluid" /> */}
                        <img src="{data.image}" alt="" />
                      </div>  
            
            </div> 
        </>

    )
}

export default Buy
